import React from 'react';
import styled from "styled-components";
import {Button, Container, Subtitle, Title} from "../../styles/common";

const StyledNews = styled(Container)`
  padding-top: 9rem;
  padding-bottom: 9rem;
`

const NewsHeader = styled.div`
  display: flex;
  align-items: end;
  justify-content: space-between;
`

const NewsHeaderTitleBlock = styled.div`
  max-width: 970px;
`

function News() {
  return (
    <StyledNews>
      <NewsHeader>
        <NewsHeaderTitleBlock>
          <Subtitle>News</Subtitle>
          <Title>Discover weekly content about organic food, & more</Title>
        </NewsHeaderTitleBlock>
        <Button></Button>
      </NewsHeader>
    </StyledNews>
  );
}

export default News;
